description:
Verenigd Koninkrijk / Verenigde Staten
Drama
100 minuten

goed

met Emily Blunt, Jim Broadbent en Rupert Friend

De jonge koningin Victoria (Emily Blunt) heeft moeite om zich aan te passen aan de strenge etiquette van het Britse hof. 
Daarnaast zijn er zoveel andere taken die haar aandacht vragen dat haar vrijheid ernstig te lijden heeft. Maar met de 
aanwezigheid van de Duitse prins Albert lijkt dat anders te worden.
